(1302, '<p class="MsoNormal" align="center" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" center;"=""><b><span class="style4" style="color: rgb(0, 0, 102); font-size: 24pt;"><br></span></b></p><p class="MsoNormal" align="center" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" center;"=""><b><span class="style4" style="color: rgb(0, 0, 102); font-size: 24pt;"><br></span></b></p><p class="MsoNormal" align="center" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" center;"=""><b><span class="style4" style="color: rgb(0, 0, 102); font-size: 24pt;">Les études à la Faculté des Sciences &amp; Techniques – Marrakech<o:p></o:p></span></b></p><p class="MsoNormal" align="center" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" center;"=""><b><span class="style4" style="color: rgb(0, 0, 102); font-size: 24pt;"><br></span></b></p><h2 style="font-family: Arial;"><span style="font-size: 8pt; color: windowtext;"><o:p></o:p></span><b><span class="style4" style="color: rgb(0, 0, 102);">&nbsp; &nbsp;1-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></b><span class="style4" style="color: rgb(0, 0, 102);">Organisation Générale<o:p></o:p></span></h2><div><span class="style4" style="color: rgb(0, 0, 102);"><br></span></div><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 18pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;"=""><span style="font-size: 8pt;"><o:p>&nbsp;</o:p>&nbsp;</span>Depuis la rentrée universitaire 2006-2007, l’organisation des enseignements à la FSTM adopte les nouvelles dispositions préconisées par la réforme de l’enseignement supérieur relative aux établissements à accès limité (FST, EST et Ecoles d’Ingénieurs). Le but de cette réforme est triple :</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-indent:="" -14.7pt;"=""><span style="font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>favoriser la mobilité des étudiants&nbsp;;</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-indent:="" -14.7pt;"=""><span style="font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>permettre plus de souplesse entre les différents parcours&nbsp;;</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-indent:="" -14.7pt;"=""><span style="font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>favoriser une orientation progressive des étudiants, notamment par le biais de passerelles, en fonction de leurs objectifs et de leur environnement socio-économique.</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;"=""><span style="font-size: 8pt;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;"="">L’architecture générale adoptée dans le cadre de la réforme est présentée dans la figure ci-après. Dans cette architecture, les FST sont habilitées à délivrer les diplômes nationaux suivants&nbsp;:</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" text-indent:="" 18pt;="" line-height:="" 15.3333px;"="">-<span style="font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>la Licence en sciences et techniques préparée en trois années ou 6 semestres après le Baccalauréat,</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" text-indent:="" 18pt;="" line-height:="" 15.3333px;"="">-<span style="font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>le Master en sciences et techniques préparé en deux années ou 4 semestres après la Licence.</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" text-indent:="" 18pt;="" line-height:="" 15.3333px;"="">-<span style="font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>le Doctorat en sciences et techniques préparé en trois années minimum après le Master.</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" line-height:="" 15.3333px;"="">Cette nouvelle architecture, désignée par le sigle LMD, est celle qui est universellement adoptée.</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" line-height:="" 15.3333px;"=""><span style="letter-spacing: 0.3pt;">Toutefois, à la demande de l’étudiant, l’établissement peut délivrer le DEUST (Bac +2) (diplôme des études universitaires en sciences et techniques).<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" line-height:="" 15.3333px;"=""><span style="letter-spacing: 0.3pt;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" line-height:="" 15.3333px;"=""><span style="letter-spacing: 0.3pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><img width="495" height="621" src="http://www.fstg-marrakech.ac.ma/img/image1.jpg" v:shapes="_x0000_i1025" style="font-family: " comic="" sans="" ms";="" font-size:="" 11.3333px;="" text-align:="" center;"=""></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" line-height:="" 15.3333px;"=""><br></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" line-height:="" 15.3333px;"="">En plus de ce système LMD, les FST sont habilitées à délivrer les diplômes ci-dessous&nbsp;:</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-indent:="" -18pt;="" line-height:="" 15.3333px;"=""><span style="font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Diplôme d’Ingénieur d’Etat&nbsp;(Bac +5)&nbsp;; le cycle d’Ingénieur est&nbsp;&nbsp;préparé en trois années ou 6 semestres&nbsp;;</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-indent:="" -18pt;="" line-height:="" 15.3333px;"=""><span style="font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Diplôme Universitaire de Technologie (DUT) préparée en deux années ou 4 semestres après le Baccalauréat.</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;"=""><o:p>&nbsp;</o:p></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" line-height:="" 15.3333px;"="">Les enseignements sont organisés en filières, chaque filière est constituée d’un ensemble cohérent de modules pris dans un ou plusieurs champs disciplinaires, ayant pour objectif de faire acquérir à l’étudiant des connaissances, des aptitudes et des compétences.</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" text-indent:="" -18pt;="" line-height:="" 15.3333px;"="">-<span style="font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>L’année universitaire est composée de deux semestres, comprenant chacun 16 semaines d’enseignement et d’évaluation.</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" text-indent:="" -18pt;="" line-height:="" 15.3333px;"="">-<span style="font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Chaque semestre comprend 4 modules avec un volume horaire global de 360 heures minimum.</p><p class="MsoBodyTextIndent3" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10.6667px; font-family: " times="" new="" roman";="" text-indent:="" -18pt;="" line-height:="" 12.2667px;"=""><span style="font-size: 10pt; line-height: 15.3333px;">-<span style="font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 10pt; line-height: 15.3333px;">Le module est l’unité fondamentale du système de formation. Il est dispensé au cours d’un semestre sous forme de cours théorique et/ou de travaux dirigés et/ou&nbsp;&nbsp;de travaux pratiques portant sur une à quatre matières ayant des objectifs, des contenus et une didactique qui leur sont propres. Il peut être également constitué, en partie ou en totalité, par une activité pratique consistant en travaux sur le terrain, stage ou projet.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt 36pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" text-indent:="" -18pt;="" line-height:="" 15.3333px;"="">-<span style="font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Le module est rattaché à un département qui en désigne le coordonnateur.</p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;"=""><o:p>&nbsp;</o:p></p><p class="MsoNormal" align="center" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" center;"=""><img width="410" height="278" src="http://www.fstg-marrakech.ac.ma/img/image2.jpg" v:shapes="_x0000_i1026"></p><h2 class="MsoNormal" align="center" style="font-family: Arial; text-align: center;">&nbsp;</h2><h2 class="MsoNormal" style="font-family: Arial; margin-left: 36pt; text-align: justify; text-indent: -18pt;"></h2><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" justify;="" line-height:="" 15.3333px;"=""><span style="text-align: start; font-size: 10pt;"><br clear="all" style="break-before: page;"></span><span style="font-family: Arial; font-size: 10.6667px; text-align: start;"></span></p><p class="MsoNormal" align="center" style="margin: 0cm 0cm 0.0001pt; font-size: 10pt; font-family: " times="" new="" roman";="" text-align:="" center;"=""><b><span style="font-size: 14pt;">&nbsp;</span></b></p>', '2017-06-17', '2017-06-17', '2017-06-29', '  Depuis la rentrée universitaire 2006-2007, l’organisation...', 1, 'images (1).jpg', NULL, 1, 2, 'Les études à la Faculté des Sciences & Techniques – Marrakech', 'EE0005'),
(1306, '<p style="font-size: 16px; color: rgb(51, 51, 51); margin: 2px 0px 12px; padding: 0px; border-bottom-style: none; border-bottom-width: 0px; border-top-style: none; border-top-width: 0px; line-height: 22px;"><font face="Arial, Verdana" style="font-size: 10pt;"> <img src="http://www.fstg-marrakech.ac.ma/img/baniere_fstg.jpg"></font></p><div style="font-size: 10pt;"><br></div><div style="font-size: 10pt;"><br></div><div style="font-size: 10pt;"><span style="color: rgb(51, 0, 51); font-size: xx-large;"><br></span></div><h1 style="font-weight: normal;"><span style="font-size: xx-large; color: rgb(51, 0, 51);">     </span><span style="font-size: x-large;"><span style="color: rgb(51, 0, 51);">La Faculté Des Sciences Et Techniques Ouvert Ses PortesPour L''inscription Des Bacheliers .<br></span><span style="color: rgb(51, 0, 51);">              <br></span><span style="color: rgb(51, 0, 51);">         Le Dernière délai est Le 30/06/2017.   </span></span>          </h1><div style="font-size: 10pt;">                </div><h2 style="font-size: 22px; font-weight: normal; font-family: OpenSansRegular, Arial, sans-serif; margin: 10px 0px 20px; padding: 0px; border-bottom-style: none; border-bottom-width: 0px; border-top-style: none; border-top-width: 0px; line-height: 26px;"><span style="color: rgb(0, 102, 0);">               S’inscrire:</span></h2><div class="chapo-rubrique" style="font-size: 10pt; margin: 0px; padding: 0px;"><p style="font-family: inherit; background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 16px; margin: 2px 0px 12px; padding: 0px; border-bottom-style: none; border-bottom-width: 0px; border-top-style: none; border-top-width: 0px; line-height: 22px;">        <span style="font-family: OpenSansRegular, Arial, sans-serif;">Les procédures d’inscription varient selon la Filière que vous souhaitez suivre et votre profil.</span><span style="font-family: inherit;"> </span></p><p style="font-family: inherit; background-color: rgb(255, 255, 255)