e:="" italic;"="" style="font-size: 12px; font-weight: bold;"><br></span></div></div>', '2017-06-18', '2017-06-05', '2017-06-30', '  L''inscription Des Bacheliers...', 1, 'GetArticleImage (1).gif', NULL, 1, 0, 'Inscription Des Bacheliers , Déposer vos candidatures en ligne sur la plateforme UCA avant le 30 juin 2017.   ', 'EE0005'),
(1307, '<div style="font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;"><img src="http://www.centrebeaulieu-lemans.fr/wp-content/uploads/2017/05/pr%C3%A9inscription.jpg" alt="Résultat de recherche d''images pour " pré="" inscription""=""></div><span style="font-family: lato; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(51, 51, 51); letter-spacing: 1px; background-color: rgb(255, 255, 255);"><div><span style="color: rgb(51, 51, 51); font-family: lato; font-size: 15px; letter-spacing: 1px; background-color: rgb(255, 255, 255);"><br></span></div>le Doyen de la Faculté des Sciences et Techniques à Marrakech informe les nouveaux bacheliers souhaitant s''inscrire en 1ère année du Cycle Licence en Sciences et Techniques, au titre de l''année universitaire 2017-2018, que les préinscriptions se feront exclusivement&nbsp; en ligne sur le site web de la FST de Marrakech&nbsp;</span><span style="margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: lato; font-size: 15px; letter-spacing: 1px; background-color: rgb(0, 255, 0); border-style: initial; border-color: initial; border-image: initial;"></span><span style="font-family: lato; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); letter-spacing: 1px; background-color: rgb(204, 255, 204);"><a href="http://www.fstt.ac.ma/preinscription/lst/" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;"><span style="margin: 0px; padding: 0px; border: 0px;">www.fstt.ac.ma/preinscription/lst/</span></a><a href="http://www.fstt.ac.ma/preinscription/lst%C3%82" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;"><span 