(1351, '<h2 class="contentheading" style="margin: 0px; padding: 0px 0px 5px; border: 0px; line-height: 1.2; font-family: mohave; letter-spacing: 1px; background-color: rgb(255, 255, 255); font-size: 26px !important; color: rgb(221, 216, 216) !important;"><a href="http://www.fstt.ac.ma/Portail/actualites/493-etavet" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;">AVIS AUX ETUDIANTS</a></h2><div class="article-tools clearfix" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.144px; clear: both; position: relative; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><ul class="actions" style="margin: 0px; padding: 0px; border: 0px; list-style: none; float: right;"><li class="print-icon" style="margin: 0px; padding: 0px; border: 0px; background: none; line-height: 1; overflow: hidden; display: inline;"><a href="http://www.fstt.ac.ma/Portail/actualites/493-etavet?tmpl=component&print=1&page=" title="Imprimer" rel="nofollow" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;"><img src="http://www.fstt.ac.ma/Portail/templates/ja_university/images/system/printButton.png" alt="Imprimer" style="margin: 0px 5px 0px 0px; padding: 0px; border: 0px;"></a>	</li><li class="email-icon" style="margin: 0px; padding: 0px; border: 0px; background: none; line-height: 1; overflow: hidden; display: inline;"><a href="http://www.fstt.ac.ma/Portail/component/mailto/?tmpl=component&template=ja_university&link=5f9b3a4a0f34ae45974c7f804020a128dc117e68" title="E-mail" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;"><img src="http://www.fstt.ac.ma/Portail/templates/ja_university/images/system/emailButton.png" alt="E-mail" style="margin: 0px 5px 0px 0px; padding: 0px; border: 0px;"></a></li></ul><dl class="article-info" style="margin: 0px; padding: 0px; border: 0px; float: left; width: 500.5px; color: rgb(153, 153, 153); font-weight: bold;"><dt class="article-info-term" style="margin: 0px; padding: 0px 5px 0px 0px; border: 0px; display: inline;">Détails</dt> <dd class="category-name" style="margin: 0px; padding: 0px 5px 0px 13px; border: 0px; display: inline; background: url("../images/icon-folder.png") left center no-repeat;">Catégorie : <span style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); font-weight: normal;"><a href="http://www.fstt.ac.ma/Portail/actualites" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;">actualités</a></span></dd></dl></div><p style="margin: 15px 0px; padding: 0px; border: 0px; font-family: lato; letter-spacing: 1px; line-height: 22.5px; font-size: 15px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 35.45pt;"><span style="margin: 0px; padding: 0px; border: 0px; font-size: 12pt; line-height: 24px; font-family: arial, helvetica, sans-serif; color: rgb(0, 0, 0);">Une rencontre a eu lieu, entre le Doyen de la FST et le Responsable d’everis Centers Morocco (TetouanShore), et a porté sur les opportunités d’intégration de nos lauréats dans everis et sur une éventuelle collaboration dans l’élaboration des programmes de formation dans le domaine des Sciences de l’Information.</span></p><p style="margin: 15px 0px; padding: 0px; border: 0px; font-family: lato; letter-spacing: 1px; line-height: 22.5px; font-size: 15px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); text-indent: 35.45pt;"><span style="margin: 0px; padding: 0px; border: 0px; font-family: arial, helvetica, sans-serif; color: rgb(0, 0, 0);"><span style="margin: 0px; padding: 0px; border: 0px; font-size: 12pt; line-height: 24px;"></span><span style="margin: 0px; padding: 0px; border: 0px; font-size: 12pt; line-height: 24px;">Ainsi les étudiants intéressés pour rejoindre le groupe everis peuvent postuler sur Linkedin ou par mail à l’adresse suivante :</span><span style="margin: 0px; padding: 0px; border: 0px; font-size: 12pt; background-color: rgb(255, 255, 0);"><a href="mailto: <script type=''text/javascript''> <!-- var prefix = ''ma'' + ''il'' + ''to''; var path = ''hr'' + ''ef'' + ''=''; var addy80446 = ''recruiting.centers.morocco'' + ''@''; addy80446 = addy80446 + ''everis'' + ''.'' + ''ma''; document.write(''<a '' + path + ''\\'''' + prefix + '':'' + addy80446 + ''\\''>''); document.write(addy80446); document.write(''<\\/a>''); //-->\\n </script><script type=''text/javascript''> <!-- document.write(''<span style=\\''display: none;\\''>''); //--> </script>Cette adresse e-mail est prot%C3%A9g%C3%A9e contre les robots spammeurs. Vous devez activer le JavaScript pour la visualiser. <script type=''text/javascript''> <!-- document.write(''</''); document.write(''span>''); //--> </script>" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;"><span style="margin: 0px; padding: 0px; border: 0px; line-height: 16.64px; color: rgb(0, 0, 0);"> </span></a><a href="mailto:recruiting.centers.morocco@everis.ma" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;">recruiting.centers.morocco@everis.ma</a></span></span></p><p style="margin: 15px 0px; padding: 0px; border: 0px; font-family: lato; letter-spacing: 1px; line-height: 31px; font-size: 15px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; border: 0px; font-size: 15pt; line-height: 20.8px; font-family: Garamond, serif;"><span style="margin: 0px; padding: 0px; border: 0px; color: rgb(0, 0, 0);">Pour plus d’information sur everis</span> (<a href="http://www.fstt.ac.ma/Portail/images/Slide1.jpg" style="margin: 0px; padding: 0px; border: 0px; color: rgb(102, 102, 102); text-decoration-line: none;"><span style="margin: 0px; padding: 0px; border: 0px; color: rgb(0, 176, 240);">cliquez ici</span></a>)</span></p>', '2017-06-18', '2017-06-04', '2017-06-07', 'Une rencontre a eu lieu...', 2, 'Fotolia_4713529_S.jpg', NULL, 1, 6, 'AVIS AUX ETUDIANTS', 'EE0006');
