(1355, '&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://www.fstg-marrakech.ac.ma/calen_clip_image002.png">&nbsp;<div><h3>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; La Creation de la Faculté Des Sciences Et Techniques :</h3><div>&nbsp; &nbsp; &nbsp;<div><strong style="font-family: Arial; font-size: 10.6667px;">A l’occasion de sa première participation au ‘’Moroccan Solar Race 2014 Challenge‘’, l’Equipe de l’Université Cadi Ayyad termine la course en remportant la première place à l’échelle nationale et la cinquième à l’échelle internationale avec la &nbsp;voiture solaire SOCCAR1. En conséquence, l’équipe de l’Université Cadi Ayyad est invitée à participer à Abu Dhabi Solar Challenge en janvier 2015.</strong><p style="font-family: Arial; font-size: 10.6667px;">SOCCAR1 est la première voiture solaire imaginée et réalisée par la FST de Marrakech sous la coordination du Professeur Said Doubabi en collaboration avec le Professeur Echaibi Mohamed de l’EST Safi et le Professeur Rachid Ahmed de l’université de Picardie Jule Verne. Sa conception respecte un cahier des charges sportif et technique précis.</p><p style="font-family: Arial; font-size: 10.6667px;">SOCCAR 1 utilise une technologie de pointe : panneaux photovoltaïques flexibles et MPPT&nbsp;&nbsp;à haut rendement, moteur-roue, contrôleur optimisé, le tout avec un budget limité et en un temps record.</p><p style="font-family: Arial; font-size: 10.6667px;"><span style="color: rgb(0, 0, 102);">Caractéristiques Techniques&nbsp;de la voiture SOCCAR1:<br>Dimensions : L*l*h = 4m*1.8m*0.6m<br>Panneaux Photovoltaïques Flexibles 800Wc<br>Moteur roue Brushless 800W<br>Batterie au Plomb 48V- 48AH pour la puissance, 12V au Lithium pour les données et signalisations.&nbsp;<br>vitesse max : 50Km/h<br>Weight /Masse : 140Kg</span></p><h1 style="font-family: Arial; font-size: 10.6667px;"><span style="color: rgb(0, 0, 102);">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><span style="background-color: rgb(255, 255, 102);">Les images Concerne a cette Création :</span></h1></div></div></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://www.fstg-marrakech.ac.ma/IMG_0641.png"></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://www.fstg-marrakech.ac.ma/IMG_0601.png" style="font-size: 10pt;"></div><div><br></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://www.fstg-marrakech.ac.ma/IMG_0636.png" style="font-size: 10pt;"></div><div><br></div><div><span style="background-color: rgb(255, 255, 102);"><br></span></div><div><img src="https://www.uca.ma/public/files/images/site-1-463c4e32a670ff40d6fd54867ac55142-1864755145.png" alt="Résultat de recherche d''images pour &quot;fstg formation&quot;" style="font-size: 10pt;"></div>', '2017-06-18', '2017-06-18', '2017-06-23', 'A l’occasion de sa première particip...', 1, 'ikhtira3.png', NULL, 2, 1, 'la première création de la FSTG', 'EE0005'),
