255);">M. OUCHALHI&nbsp; RACHID</td><td class="xl68" style="margin: 0px; padding: 5px; border: 1px solid rgb(0, 0, 0); font-size: 13.2px; width: 341px; background-color: rgb(221, 255, 255);">&nbsp; Représentant des étudiants des cycles Master &amp; Ingénieur</td></tr><tr style="margin: 0px; padding: 0px; border: 0px; height: 30pt;"><td class="xl68" style="margin: 0px; padding: 5px; border: 1px solid rgb(0, 0, 0); font-size: 13.2px; width: 341px; background-color: rgb(221, 255, 255);">CHAABI HASNAA</td><td class="xl68" style="margin: 0px; padding: 5px; border: 1px solid rgb(0, 0, 0); font-size: 13.2px; width: 341px; background-color: rgb(221, 255, 255);">&nbsp; Représentant des étudiants du cycle Doctorat</td></tr></tbody></table>', '2017-06-18', '2017-06-18', '2017-06-28', 'Membres de la ...', 1, 'fsts_act1.png', NULL, 2, 4, 'Commission Pédagogique', 'EE0006');
