(1403, '<p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; background-color: rgb(255, 255, 255);"><br></p><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; background-color: rgb(255, 255, 255);"><br></p><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; background-color: rgb(255, 255, 255);">Sur le plan de l''architecture pédagogique, la FST de 1Marrakechcompte plus de 30 filières aux différents cycles de formations. Et sur celui de la recherche scientifique, notre établissement dédie le centre des études doctorales (CED) aux activités de la recherche qui confèrent, d''ailleurs, à cette institution scientifique ses lettres de noblesse. Cette dernière regroupe 27 équipes de recherches dans neuf laboratoires de recherche accrédités par les autorités scientifiques compétentes.</p><div style="font-family: TitilliumText14L-600wt; font-size: 12px; background-color: rgb(255, 255, 255);"><h4 style="margin: 0px 0px 20px 165px; font-weight: inherit; color: rgb(10, 63, 123); font-size: 18px; border-left: 1px solid rgb(242, 148, 0); padding: 0px 10px 0px 20px;">A l''instar des autres établissements du réseau, la FST de Marrakech a adopté le système L.M.D (Licence, Master, Doctorat) et ce, depuis 2003. Conformément à cette vision pédagogique novatrice, les cursus préconisés font fructifier des atouts considérables à savoir :</h4><ul style="margin: 0px 0px 0px 10px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 35px; padding-left: 0px !important;"><li style="margin: 0px 0px 0px 45px; padding: 0px; color: rgb(102, 102, 102); list-style-image: url(&quot;../images/li.png&quot;) !important;">L''implication pédagogique et scientifique de nos équipes d''enseignants-chercheurs.</li><li style="margin: 0px 0px 0px 45px; padding: 0px; color: rgb(102, 102, 102); list-style-image: url(&quot;../images/li.png&quot;) !important;">Notre implantation locale et régionale (bassin d''emploi exceptionnellement dynamique).</li><li style="margin: 0px 0px 0px 45px; padding: 0px; color: rgb(102, 102, 102); list-style-image: url(&quot;../images/li.png&quot;) !important;">Des conditions d''études et un environnement pédagogique de qualité favorisant l''épanouissement scientifique de nos étudiants.</li><li style="margin: 0px 0px 0px 45px; padding: 0px; color: rgb(102, 102, 102); list-style-image: url(&quot;../images/li.png&quot;) !important;">Une action très soutenue en direction de la formation continue.</li><li style="margin: 0px 0px 0px 45px; padding: 0px; color: rgb(102, 102, 102); list-style-image: url(&quot;../images/li.png&quot;) !important;">Notre ouverture sur le monde socioéconomique.</li><li style="margin: 0px 0px 0px 45px; padding: 0px; color: rgb(102, 102, 102); list-style-image: url(&quot;../images/li.png&quot;) !important;">la mise en place de nombreux accords de coopération et de collaboration.</li></ul></div>', '2017-06-18', '2017-06-18', '2017-06-21', 'Sur le plan de l''archit...', 1, 'informatique.gif', NULL, 2, 4, 'L’approche pédagogique', 'EE0003'),
(1404, '<div class="field field-name-body field-type-text-with-summary field-label-hidden" style="width: 766px; font-family: TitilliumText14L-600wt; font-size: 12.852px; background-color: rgb(255, 255, 255);"><div class="field-items"><div class="field-item even" property="content:encoded"><div id="dvcdoc01" style="width: 383px; float: left;"><h1 style="margin: 1em 0px 0.5em; font-weight: inherit; font-size: 16px; color: rgb(237, 144, 0); padding: 0px 0px 10px;">Présentation</h1><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 22px;">le Centre d’Etudes Doctorales Sciences et Techniques a connu l’accréditation de quatre formations doctorales :....</p><div id="prescdoc" style="margin-left: 40px;"><span style="color: rgb(242, 148, 0);">Principaux thèmes de recherche</span><ul style="margin: 1em 0px; padding: 0px 0px 0.25em 2.5em;"><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Agroalimentaire.</li><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Biochimie et Neuroscience.</li><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Energies renouvelables, solaire et photovoltaïque.</li><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Chimie et Physico Chimie des procédés.</li><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Mathématiques, Informatique, Réseaux et TIC.</li><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Environnement .</li><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Mécanique et Electromécanique.</li><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Substances Naturelles.</li><li style="list-style: none; color: rgb(10, 63, 123); cursor: pointer;">Sciences des Matériaux.</li></ul><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 22px;">&nbsp;</p></div></div><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 22px;"><img alt="" src="http://www.fsts.ac.ma/themes/bartik/images/cedoc01.jpg" style="border: 0px; outline: 0px; width: 350px; height: 327px;"></p></div></div></div><div class="field field-name-field-presentation1 field-type-file field-label-hidden" style="margin: 25px 0px 0px 10px; font-family: TitilliumText14L-600wt; font-size: 12.852px; background-color: rgb(255, 255, 255);"><div class="field-items"><div class="field-item even"><br></div></div></div>', '2017-06-18', '2017-06-18', '2017-06-29', 'le Centre d’Etudes...', 1, 'doctorat.jpg', NULL, 3, 2, 'Présentation Du centre D’étude Doctorat', 'EE0005'),
(1405, '<span style="color: rgb(233, 142, 0); font-family: TitilliumText14L-600wt; font-size: 14px; background-color: rgb(255, 255, 255);">&nbsp; &nbsp; &nbsp;</span><div><span style="color: rgb(233, 142, 0); font-family: TitilliumText14L-600wt; font-size: 14px; background-color: rgb(255, 255, 255);">&nbsp; &nbsp; Centre Régional d’Analyses et de caractérisation:</span></div><div><span style="color: rgb(233, 142, 0); font-family: TitilliumText14L-600wt; font-size: 14px; background-color: rgb(255, 255, 255);"><br></span></div><div><span style="color: rgb(233, 142, 0); font-family: TitilliumText14L-600wt; font-size: 14px; background-color: rgb(255, 255, 255);"><br></span></div><div><img src="http://www.fsts.ac.ma/themes/bartik/images/crac01.jpg"></div><div><br></div><div><br></div><div><h1 style="margin: 1em 0px 0.5em; font-weight: inherit; font-size: 1.357em; color: rgb(237, 144, 0); font-family: TitilliumText14L-600wt; background-color: rgb(255, 255, 255);">Crac:</h1></div><div><br></div><div><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 22px; background-color: rgb(255, 255, 255);"><span class="formation-c-t" style="font-size: 18px; line-height: 21px; font-weight: bold;">Introduction</span></p><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 22px; background-color: rgb(255, 255, 255);">La Région Chaouia Ouardigha possède un des plus importants secteurs industriels à l’échelle national. Elle compte actuellement plus de 350 unités industrielles (4% du national) qui emploient plus de 17 000 personnes en permanence (3% de l’effectif industriel national). L’industrie chimique et para chimique (céramiques, ciment, peintures…) occupe une place très importante &nbsp;dans la région et elle est en cours de développement. La région possède plusieurs zones industrielles opérationnelles, d’autres sont en cours de viabilisation, en vue d’attirer des investissements de grande envergure dans les secteurs avérés porteurs par rapport aux nouveaux pôles de développement identifiés.</p><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 22px; background-color: rgb(255, 255, 255);">Ainsi, des sites mobilisables ont été programmés dans le cadre de la mise en œuvre de la stratégie de développement économique et social de la région. L’ensemble de ces activités vont nécessiter un soutien analytique de qualité pour leur compétitivité à l’échelle nationale et internationale. L''Université Hassan Ier, de part son implantation dans cette région stratégique, doit acquérir une grande dimension, en devenant pionnière en recherche scientifique, développement et assistance technique aux opérateurs économiques.</p><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 22px; background-color: rgb(255, 255, 255);">La création du Centre Régional d’Analyses et de caractérisation (CRAC) s’inscrit dans la stratégie du développement de la région Chaouia-Ouardigha. À l’origine, il fut conçu pour une initiative conjointe des unités de recherche de l’université, afin de créer une synergie de compétences interactives pour promouvoir la recherche scientifique au niveau de la région Chaouia-Ouardigha.</p><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 22px; background-color: rgb(255, 255, 255);"><img src="http://www.fsts.ac.ma/themes/bartik/images/crac02.jpg"></p></div>', '2017-06-18', '2017-06-18', '2017-06-29', '    Centre Régional d’An....', 1, 'crac01.jpg', NULL, 3, 5, ' Centre Régional d’Analyses et de caractérisation', 'EE0003'),
(1406, '<div class="field field-name-body field-type-text-with-summary field-label-hidden" style="float: right; width: 372px; margin: -8px 0px 0px; font-family: TitilliumText14L-600wt; font-size: 12.852px; background-color: rgb(255, 255, 255);"><div class="field-items"><div class="field-item even" property="content:encoded"><h1 style="margin: 1em 0px 0.5em; font-weight: inherit; font-size: 16px; color: rgb(237, 144, 0); padding: 0px;">Présentation</h1><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 18px !important;"><span class="formation-c-t" style="font-size: 18px; line-height: 21px; font-weight: bold;">Depuis la mise en place de la réforme&nbsp;<br>de l''enseignement supérieur et en particulier le cycle de doctorat,</span></p><p style="margin: 0px; font-family: TitilliumText14L-400wt; font-size: 12px; padding: 0px 7px 0px 0px; line-height: 18px !important;">ce dernier est organisé au sein des Centres d’Etudes Doctorales domiciliés dans les établissements universitaires, conformément aux articles 19 et 24 de la loi n° 01-60 portant organisation de l''enseignement supérieur. Le Centres d’Etudes Doctorales « Sciences et Techniques » domiciliés à la FST de Settat, regroupe 17 laboratoires et 35 équipes de recherche. Ces derniers représentent les structures d’accueilles des doctorants, en leur proposant 4 formation doctorales :</p></div></div></div><div class="field field-name-field-images-recherche-scientifi field-type-image field-label-hidden" style="float: left; width: 395px; height: 375px; font-family: TitilliumText14L-600wt; font-size: 12.852px; background-color: rgb(255, 255, 255);"><div class="field-items"><div class="field-item even"><div id="field-slideshow-1-wrapper" class="field-slideshow-wrapper"><div class="field-slideshow field-slideshow-1 effect-fade timeout-4000 with-pager with-controls field-slideshow-processed" style="overflow: hidden; max-width: 100%; width: 395px; height: 394px; padding-right: 0px; position: relative;"><div class="field-slideshow-slide field-slideshow-slide-1 even first" style="max-width: 100%; height: 19px; width: 395px; position: absolute; top: 0px; left: 0px; z-index: 3; opacity: 1;"><img class="field-slideshow-image field-slideshow-image-1" typeof="foaf:Image" src="http://www.fsts.ac.ma/sites/default/files/Recherche-scientifique-pres_0.jpg" width="395" height="375" alt="" style="border: 0px; outline: 0px; max-width: 102%; height: auto !important; width: auto !important; margin: 0px 0px 1em;"></div></div><div id="field-slideshow-1-controls" class="field-slideshow-controls" style="position: relative; z-index: 3; top: -230px; height: 0px;"><a href="http://www.fsts.ac.ma/fr/Recherche-scientifique/Presentation#" class="prev" style="color: rgb(0, 113, 179); text-decoration-line: none; background: url(&quot;../images/prev-apropos.jpg&quot;) no-repeat; width: 52px; height: 52px; font-size: 0px; float: left;">Préc.</a><a href="http://www.fsts.ac.ma/fr/Recherche-scientifique/Presentation#" class="next" style="color: rgb(0, 113, 179); text-decoration-line: none; background: url(&quot;../images/next-apropos.jpg&quot;) no-repeat; width: 52px; height: 52px; font-size: 0px; float: right;">Suivant</a></div></div></div></div></div><div class="field field-name-field-presentation1 field-type-file field-label-hidden" style="border-left: 2px solid rgb(242, 148, 0); float: right; margin: 0px 50px 0px 0px; padding: 0px 0px 0px 15px; font-family: TitilliumText14L-600wt; font-size: 12.852px; background-color: rgb(255, 255, 255);"><div class="field-items"><div class="field-item even"><span class="file"><a href="http://www.fsts.ac.ma/sites/default/files/Fsts_9.pdf" type="application/pdf; length=1537518" title="Fsts.pdf" style="color: rgb(0, 113, 179); text-decoration-line: none;">Biologie Santé et Environnement (BSE)</a></span></div><div class="field-item odd"><span class="file"><a href="http://www.fsts.ac.ma/sites/default/files/Fsts_10.pdf" type="application/pdf; length=1537518" title="Fsts.pdf" style="color: rgb(0, 113, 179); text-decoration-line: none;">Chimie Appliquée et Environnement (CAE)</a></span></div><div class="field-item even"><span class="file"><a href="http://www.fsts.ac.ma/sites/default/files/Fsts_11.pdf" type="application/pdf; length=1537518" title="Fsts.pdf" style="color: rgb(0, 113, 179); text-decoration-line: none;">Physique et Sciences de l’Ingénieur (PSI)</a></span></div><div class="field-item odd"><span class="file"><a href="http://www.fsts.ac.ma/sites/default/files/Fsts_12.pdf" type="application/pdf; length=1537518" title="Fsts.pdf" style="color: rgb(0, 113, 179); text-decoration-line: none;">Mathématiques Appliquées et Informatique (MAI)</a></span></div><div class="field-item odd"><div id="dpres1" style="float: left; width: 392px; font-size: 12px;"><p style="margin: 0px; font-family: TitilliumText14L-400wt;">En plus des activités de recherche, les doctorants doivent participer aux formations complémentaires obligatoires (enseignements spécifiques, gestion de projets, entreprenariat, langues et communication, initiation à la pédagogie universitaire, monitorat, tutorat, forums doctoraux), permettant d’aider le doctorant à son insertion professionnel.</p><h3 style="margin: 1em 0px 0.5em; font-weight: inherit;">Formation doctorale</h3><div id="dv1" style="margin-top: 15px;"><img alt="" src="http://www.fsts.ac.ma/sites/default/files/Recherche-scientifique-pres2.jpg" style="border: 0px; outline: 0px; margin-left: -10px; float: left; width: 242px; height: 236px;"><div id="vd1txt" style="width: 184.238px; float: left; margin-left: 22px;">La nouvelle structuration des études doctorales rentrée en vigueur en 2008 stipule que le cycle de doctorat est organisé au sein des centres des études doctorales créés au sein des établissements universitaires désirant préparer le diplome de doctorat. Le centre des&nbsp;</div></div></div><div id="dpres2" style="float: right; width: 370px; margin: -10px 0px 0px; font-size: 12px;"><img alt="" src="http://www.fsts.ac.ma/sites/default/files/formation-doctorale-01_0.jpg" style="border: 0px; outline: 0px; width: 370px; height: 159px;"><p style="margin: 0px; font-family: TitilliumText14L-400wt;">études doctorales regroupe les structures de recherche d''acceuil et propose des formations doctorales spécifiques et transversales aux doctorants.</p><div class="txtj" style="color: rgb(242, 148, 0); font-size: 14px;">Le centre d’études doctorales Sciences et Techniques a connu l''accréditation en 2008 de quatre formations doctorales&nbsp;</div></div></div></div></div>', '2017-06-18', '2017-06-18', '2017-06-23', 'Depuis la mise ...', 1, 'Recherche-scientifique-pres_0.jpg', NULL, 3, 4, 'Présentation Du cycle de doctorat', 'EE0006'),
